import React, { Component } from 'react';
import TopIcons from '../Desktop/TopIcons/TopIcons';
import ReactButton from './ReactProjects/HoverButton';
import TopContentWindows from '../../components/TopIconsContent/TopContentWindows';

export default class Left extends Component {
  state = {
    infoWindow: false,
    projectsWindow: false,
    contactWindow: false
  }

  render() {
    return (
      <div style = { desktopLeft }>
        <div style = { topIconsContainer }>
          <TopIcons 
            data = { this.state }
          />
        </div>
        <div style = { windowsContainer }>
          <TopContentWindows 
            data = { this.state }
          />
        </div>
        <div>
          <ReactButton />
        </div>
      </div>
    )
  }
}

const desktopLeft = {
  width: '60%',
  display: 'flex',
  flexDirection: 'column',
  justifyContent: 'space-between',
  alignItems: 'center',
  position: 'relative',
}

const topIconsContainer = {
  display: 'flex',
  justifyContent: 'space-around',
  alignItems: 'center',
  width: '100%',
  fontSize: '1.8rem',
  height: '15%'
}

const windowsContainer = {
  border: '2px solid orange',
  position: 'relative',
  height: '100%',
  width: '100%'
}
